          <Col className="center">
            <img className="center"
              src={Email}
              height = "50%"
              width = "50%"

            />
          </Col>
          <Col className="center">


            <img className="center"
              src={Social}
              height = "50%"
              width = "50%"

            />

          </Col>
        </Row>



        </div>
      );
  }
}
